$.fn.parallaxIt=function(){var b=$(window);var a=[];$(this).each(function(){a.push(new parallaxItItem($(this)))});window.onscroll=function(){var c=b.scrollTop();a.forEach(function(d){d.update(c)})}};var parallaxItItem=function(a){this.el=$(a);this.speed=parseInt(this.el.attr("data-scroll-speed"))};parallaxItItem.prototype.update=function(a){this.el.css("transform","translateY("+-(a/this.speed)+"px)")};var scrollOnClick=function(d){var c=$(d).data("scroll-on-click"),a=$(c),b=$(document).scrollTop(),e=$(window).width()>768?93:0;if(b!==(a.offset().top)){setTimeout(function(){$("body, html").animate({scrollTop:(a.offset().top-e)},"slow",function(){if(a.next().hasClass("pandora-hidden-edit")){a.next().slideDown("slow",function(){if($(window).width()<769&&$(window).width()>667){a.next().find(".flexslider").flexslider({animation:"slide",animationLoop:false,slideshow:false,minItems:3,itemWidth:245,start:function(f){$(f).css("opacity","1")}})}else{if($(window).width()<768){a.next().find(".flexslider").flexslider({animation:"slide",animationLoop:false,slideshow:false,start:function(f){$(f).css("opacity","1")}})}}})}})},500)}};var scrollBackToTop=function(){$("body, html").animate({scrollTop:0},"slow")};var scrollBackUp=function(a){$(a).parent().slideUp()};$(function(){$("[data-scroll-speed]").parallaxIt();$(".pandora-parallax-3 > div, .pandora-9 > div").click(function(){if($(this).children("video").get(0).paused){$(this).children("video").get(0).play();$(this).children(".playpause").fadeOut()}else{$(this).children("video").get(0).pause();$(this).children(".playpause").fadeIn()}})});